package com.tdp2grupo9;

import com.tdp2grupo9.modelo.Usuario;
import com.tdp2grupo9.modelo.publicacion.Imagen;

import org.junit.Before;
import org.junit.Test;
import org.junit.runner.RunWith;
import org.robolectric.RobolectricTestRunner;
import org.robolectric.annotation.Config;

import java.util.Arrays;

import static org.junit.Assert.assertEquals;
import static org.junit.Assert.assertNotEquals;
import static org.junit.Assert.assertTrue;

@RunWith(RobolectricTestRunner.class)
@Config(manifest=Config.NONE)
public class ImagenTest {

    Usuario usuario;

    @Before
    public void inicializar() {
        Usuario.getInstancia().resetearAtributos();
        Usuario.getInstancia().setFacebookId(new Long(1156897635));
        Usuario.getInstancia().setToken("12345");
        usuario = Usuario.getInstancia();
    }

    @Test
    public void encodeDecodeImagenUrlSafe() {
        //ASI LA OBTIENE DEL BITMAP
        String base64 = "R0lGODlhDwAPAKECAAAAzMzM/////wAAACwAAAAADwAPAAACIISPeQHsrZ5ModrLlN48CXF8m2iQ3YmmKqVlRtW4MLwWACH+H09wdGltaXplZCBieSBVbGVhZCBTbWFydFNhdmVyIQAAOw==";

        //CREO LA IMAGEN Y LE SETEO EL BASE 64
        Imagen imagen = new Imagen();
        imagen.setImg(Imagen.bytesFromBase64DEFAULT(base64));

        byte[] original = imagen.getImg();

        //LA ENVIO AL SERVIDOR CON URL SAFE
        String urlSafe = Imagen.base64URL_SAFEFromBytes(imagen.getImg());

        //CUANDO VUELVE DEL SERVIDOR VUELVE COMO URL SAFE
        imagen.setImg(Imagen.bytesFromBase64URL_SAFE(urlSafe));

        byte[] devuelto = imagen.getImg();

        //COMPARO LOS BYTES

        assertTrue(Arrays.equals(original, devuelto));

    }

    @Test
    public void guardarImagen() {
        String base64 = "R0lGODlhDwAPAKECAAAAzMzM/////wAAACwAAAAADwAPAAACIISPeQHsrZ5ModrLlN48CXF8m2iQ3YmmKqVlRtW4MLwWACH+H09wdGltaXplZCBieSBVbGVhZCBTbWFydFNhdmVyIQAAOw==";

        Imagen imagen = new Imagen();
        imagen.setImg(Imagen.bytesFromBase64DEFAULT(base64));
        imagen.setPublicacionId(1);

        int id = imagen.getId();
        byte[] original = imagen.getImg();

        imagen.guardarImagen(usuario.getToken());

        byte[] devuelto = imagen.getImg();

        assertTrue(Arrays.equals(original, devuelto));
        assertNotEquals(id, imagen.getId());
        assertEquals(base64, imagen.getBase64());
    }

    @Test
    public void guardarImagenChica() {
        String base64 = "R0lGODlhDwAPAKECAAAAzMzM/////wAAACwAAAAADwAPAAACIISPeQHsrZ5ModrLlN48CXF8m2iQ3YmmKqVlRtW4MLwWACH+H09wdGltaXplZCBieSBVbGVhZCBTbWFydFNhdmVyIQAAOw==";

        Imagen imagen = new Imagen();
        imagen.setImg(Imagen.bytesFromBase64DEFAULT(base64));
        imagen.setPublicacionId(1);

        int id = imagen.getId();
        byte[] original = imagen.getImg();

        imagen.guardarImagen(usuario.getToken());

        assertTrue(Arrays.equals(original, imagen.getImg()));
        assertNotEquals(id, imagen.getId());
        assertEquals(base64, imagen.getBase64());

    }

    @Test
    public void guardarImagenGrande() {
        String base64 = IMAGEN_GRANDE1;

        Imagen imagen = new Imagen();
        imagen.setImg(Imagen.bytesFromBase64DEFAULT(base64));
        imagen.setPublicacionId(2);

        int id = imagen.getId();
        byte[] original = imagen.getImg();

        imagen.guardarImagen(usuario.getToken());

        assertTrue(Arrays.equals(original, imagen.getImg()));
        assertNotEquals(id, imagen.getId());
        assertEquals(base64, imagen.getBase64());

    }

    private static final String IMAGEN_GRANDE1 = "";

}
